(window.webpackJsonp=window.webpackJsonp||[]).push([[580],{937:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1499-danh-su-đuong-tong-bo-khuc-truong-lao"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1499-danh-su-đuong-tong-bo-khuc-truong-lao"}},[n._v("#")]),n._v(" Chương 1499: Danh sư đường tổng bộ Khúc trưởng lão")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1499: Danh Sư đường tổng bộ Khúc trưởng lão【 canh thứ hai】"),t("br"),t("br"),n._v("Băng Nguyên cung nghị sự đại điện, đại trưởng lão ngồi tại gian phòng chủ vị, nhìn lấy lòng bàn tay một cái ngọc bài, bên cạnh một cái lão giả ngồi ngay ngắn, thần thái yên tĩnh."),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Để xuống ngọc bài, đại trưởng lão nhìn lại."),t("br"),t("br"),n._v("Thấy nàng xem xong, lão giả mí mắt vừa nhấc nhìn lại: “Ngươi hẳn là rõ ràng đi?”"),t("br"),t("br"),n._v("“Rõ ràng!” Vẻ mặt nghiêm túc, đại trưởng lão gật đầu."),t("br"),t("br"),n._v("“Rõ ràng liền tốt, để cho ta đặc biệt tới một chuyến, chính là muốn cẩn thận dặn dò một tiếng, lần này ngàn vạn không thể lại xuất sai! Việc quan hệ nhân tộc, không thể có mảy may qua loa, nếu không, không riêng gì các ngươi Băng Nguyên cung không chịu đựng nổi, không có người có thể chịu được!”"),t("br"),t("br"),n._v("Lão giả đứng dậy, hai tay chắp sau lưng, mang theo trách trời thương dân tình cảm: “Thị phi thành bại ở đây một lần, ta không hy vọng thời khắc sống còn, hủy ở các ngươi trên người!”"),t("br"),t("br"),n._v("“Yên tâm đi, ta đưa nàng nhốt ở Thanh Phạm điện, hơn nữa ở trong người lưu lại khốn thiên tỏa, không có gì bất ngờ xảy ra, trong ba ngày, nhất định khuất phục... Chỉ cần nàng kích hoạt thể chất, sẽ không chậm trễ!” Đại trưởng lão cũng đứng dậy ôm quyền."),t("br"),t("br"),n._v("“Vậy là tốt rồi!” Lão giả lên tiếng, quay người lại: “Vậy ta liền đi về trước, chờ tin tức tốt của ngươi...”"),t("br"),t("br"),n._v("Mới vừa đi hai bước, liền nghe phía ngoài, một cái thanh âm nhàn nhạt truyền lại mà tới, thanh âm không lớn, lại chui thẳng màng nhĩ, làm cho không người nào có thể ngăn cản."),t("br"),t("br"),n._v("“Danh sư Dương Huyền, cầu kiến Băng Nguyên cung đại trưởng lão!”"),t("br"),t("br"),n._v("“Dương Huyền?”"),t("br"),t("br"),n._v("Đại trưởng lão con ngươi co rụt lại."),t("br"),t("br"),n._v("Cách đó không xa lão giả, nghe được thanh âm này, cũng dừng bước, có chút kinh ngạc, tựa hồ có chút khó tin: “Thái thượng trưởng lão thế nào tại đây?”"),t("br"),t("br"),n._v("“Khúc trưởng lão, cái này...”"),t("br"),t("br"),n._v("Đại trưởng lão vội vàng nhìn về phía lão giả trước mắt, tràn đầy nghi ngờ."),t("br"),t("br"),n._v("“Thái thượng trưởng lão từ trước tới nay Thần Long thấy đầu không thấy đuôi, liền xem như hội trưởng, cũng không biết hành tung, tại sao lại đột nhiên xuất hiện tại đây, ta cũng không rõ lắm, nhanh lên một chút để hắn đi vào...” Khúc trưởng lão gật đầu."),t("br"),t("br"),n._v("“Tốt!”"),t("br"),t("br"),n._v("Biết như vậy thân phận người tự mình tới, đại trưởng lão không dám thất lễ, vội vàng đi tới đại điện trước cửa: “Băng Nguyên cung đại trưởng lão U Nhược Tâm, cung nghênh Dương sư!”"),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Vừa dứt lời, một bóng người chậm rãi từ không trung rơi xuống, hắn phi hành động tác không nhanh, nhưng mà bốn phía phòng ngự trận pháp, đều bị hoàn mỹ tránh thoát, thật giống như một đôi mắt, có thể nhìn thấy tất cả khí tức nguy hiểm đồng dạng, trước thời hạn làm dự phán."),t("br"),t("br"),n._v("U Nhược Tâm vội vàng cúi đầu."),t("br"),t("br"),n._v("Thân là Băng Nguyên cung người chủ trì, biết cái này đại điện chung quanh bố trí đại trận, lợi hại đến mức nào, cường đại như thế trận pháp, ở trước mặt đối phương tựa như trò đùa, có thể tùy ý đi vào, liền cảnh giới đều làm không được, thực lực mạnh mẽ, có thể xưng khủng bố."),t("br"),t("br"),n._v("Bóng người rơi trên mặt đất."),t("br"),t("br"),n._v("Đại trưởng lão U Nhược Tâm lúc này mới chậm rãi ngẩng đầu, hướng người trước mắt nhìn kỹ lại, sắc mặt có chút vàng như nến, thoạt nhìn chẳng qua chừng ba mươi tuổi, hai mắt thâm thúy, nhìn không ra sâu cạn, chỉ từ toả ra khí tức, nhìn không ra thực lực, thậm chí coi như thần thức dò xét, cũng rỗng tuếch, không biết rốt cuộc mạnh cỡ nào."),t("br"),t("br"),n._v("“Ngươi không phải Dương sư, ngươi đến cùng là... Ai?”"),t("br"),t("br"),n._v("Lông mày giương lên, híp mắt lại."),t("br"),t("br"),n._v("Dương sư Dương Huyền, nàng mặc dù không có thấy tận mắt, nhưng cũng nghe nói qua tin đồn, dung mạo năm mươi tuổi khoảng chừng, râu trắng tinh, trước mắt cái này, hoàn toàn khác biệt, căn bản chính là hai người."),t("br"),t("br"),n._v("“Thế nào, lão phu du hí đại lục, hóa thân vô số, chẳng lẽ, mỗi một cái thân phận, đều cần cùng ngươi trước thời hạn nói?” “Dương sư” Sầm mặt lại, một cỗ mạnh mẽ khí tức, phát ra, tựa hồ muốn toàn bộ đại điện đều đè sập."),t("br"),t("br"),n._v("“Tại hạ không dám!”"),t("br"),t("br"),n._v("U Nhược Tâm không dám phản bác."),t("br"),t("br"),n._v("Nghi ngờ bên trong, quay đầu nhìn về phía trong đại điện Khúc trưởng lão, lại thấy hắn đi ra."),t("br"),t("br"),n._v("“Thái thượng trưởng lão, là dạo chơi nhân gian, nhưng lấy danh sư thân phận thăm hỏi, tất nhiên sẽ bản khuôn mặt gặp người, ngươi không phải Dương sư, đến cùng là ai? Giả mạo Danh Sư đường đỉnh phong danh sư, nhưng biết tội danh?”"),t("br"),n._v("Khúc trưởng lão nhìn qua."),t("br"),t("br"),n._v("U Nhược Tâm chưa thấy qua Danh Sư đường tổng bộ Dương Huyền, nhưng mà hắn gặp qua!"),t("br"),t("br"),n._v("Trước mắt vị này, mặc kệ dung mạo vẫn là khí tức trên thân, đều cùng đã gặp hoàn toàn khác biệt, làm sao lại là Dương sư?"),t("br"),t("br"),n._v("Nếu thật là, hắn đôi mắt này, đã có thể không cần!"),t("br"),t("br"),n._v("“Ừm?”"),t("br"),t("br"),n._v("Thấy rõ nói chuyện vị này, “Dương sư” Trong lòng “Lộp bộp” Một chút."),t("br"),t("br"),n._v("Trước mắt vị này, người mặc danh sư trường bào, huy chương trước ngực, chín khỏa sao lóng lánh ánh sáng, mang theo “Tổng bộ” Hai chữ, vừa nhìn liền biết theo Danh Sư đường tổng bộ mà tới."),t("br"),t("br"),n._v("Băng Nguyên cung, làm sao lại toát ra cái Danh Sư đường tổng bộ cửu tinh danh sư?"),t("br"),t("br"),n._v("Vị này Dương sư, tự nhiên vẫn là Trương Huyền, đem Triệu Nhã thu vào không gian gấp sau, hỏi rõ ràng vị trí, lại không che giấu dấu vết, bay thẳng tới."),t("br"),t("br"),n._v("Vốn cho rằng, bằng vào Thiên đạo chân khí thần kỳ, cùng nhiều lần ngụy trang trải qua, có thể ngay từ đầu liền trấn trụ đối phương, để hắn tin tưởng mình liền là Dương Huyền, nằm mơ đều không có nghĩ đến, trực tiếp gặp một cái Danh Sư đường tổng bộ danh sư."),t("br"),t("br"),n._v("Cái này gọi chuyện gì!"),t("br"),t("br"),n._v("Thật đúng là xuất sư bất lợi!"),t("br"),t("br"),n._v("Danh Sư đường người của tổng bộ, nhất định gặp qua chân chính Dương Huyền, vừa mới ngụy trang, liền bị nhìn thấu... Còn thế nào giả bộ đi xuống?"),t("br"),t("br"),n._v("Trong lòng tràn đầy căng thẳng, trên mặt lại không biểu hiện ra ngoài, Trương Huyền ngón tay bỗng nhiên bắn ra, một đạo kiếm khí, lập tức hướng đối diện Khúc trưởng lão bắn tới."),t("br"),t("br"),n._v("Đạo kiếm khí này, mang theo tốc độ áo nghĩa, tựa như không nhận thời gian hạn chế, từ khi đầu ngón tay xuất hiện, liền đến đến trước mặt, thẳng tắp đâm về đối phương mi tâm."),t("br"),t("br"),n._v("“Ừm?”"),t("br"),t("br"),n._v("Không nghĩ tới bị vạch trần thân phận, đối phương trực tiếp ra tay, Khúc trưởng lão sầm mặt lại, cong ngón búng ra, một vệt ánh sáng màng xuất hiện tại bên ngoài thân."),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Vốn cho rằng kiếm mang đối phương, sẽ đâm vào phía trên, ai biết mới vừa cùng màng ánh sáng đụng một cái, lập tức biến mất không thấy hình bóng, hình như chưa hề xuất hiện qua đồng dạng."),t("br"),t("br"),n._v("Đạo kiếm mang này, thế mà không có chút nào lực công kích, là cố ý thăm dò!"),t("br"),t("br"),n._v("Tốc độ nhanh chóng, liền xem như hắn, đều không có nhìn ra."),t("br"),t("br"),n._v("Híp mắt lại, Khúc trưởng lão đang muốn quát tháo, chỉ thấy đối diện “Giả Dương Huyền”, lông mày nhăn lại, lạnh lùng nhìn lại, một cái truyền âm ở bên tai vang lên: “Khúc Bất Bình, trong cơ thể ngươi tu luyện Giang Lưu quyết hình thành kinh mạch vặn vẹo đã toàn bộ chữa khỏi, vẫn là ngươi cùng Bạch Vũ Hoàng đối chiến, lưu lại ám thương tiêu trừ? Dạng gì lá gan, để ngươi cũng nghi ngờ lão phu?”"),t("br"),t("br"),n._v("“Ah?”"),t("br"),t("br"),n._v("Vừa định nói, một chút nuốt đến cổ họng bên trong, Khúc trưởng lão sửng sốt."),t("br"),t("br"),n._v("Giang Lưu quyết, là hắn sáng lập ra công pháp, chân khí như là Giang Lưu cuộn trào mãnh liệt, uy lực vô tận, chỉ bất quá, có đặc thù thiếu hụt, thời gian dài lực lượng bạo phát, sẽ để cho kinh mạch không chịu nổi, sinh ra vặn vẹo."),t("br"),t("br"),n._v("Thật giống như đường sông đồng dạng, nước sông lớn, mỗi lần đều điên cuồng cọ rửa, bờ sông, đê nhất định đều sẽ biến hình, cùng lúc trước xây dựng không tại tương đồng."),t("br"),t("br"),n._v("Danh sư cấp bậc đạt tới cửu tinh, về tu vi cùng thân thể, mỗi một cái mấu chốt đều là lớn nhất cơ mật, không thể tiết lộ ra ngoài, nếu không, nhất định ảnh hưởng đến toàn bộ nhân tộc an nguy... Trước mắt vị này, một cái nói ra hắn tình huống, thậm chí liền năm đó cùng Dị Linh tộc Bạch Vũ Hoàng chiến đấu lưu lại ám thương cũng biết..."),t("br"),t("br"),n._v("Chẳng lẽ, thật sự là Dương sư?"),t("br"),t("br"),n._v("Có thể dung mạo, khí chất, hoàn toàn khác biệt ah!"),t("br"),t("br"),n._v("Đang tại nghi ngờ, liền nghe đến thanh âm lần nữa truyền lại mà tới."),t("br"),t("br"),n._v("“Lão phu gần nhất tu luyện có chỗ đột phá, thoát thai hoán cốt, dung mạo và khí chất đều phát sinh biến hóa nghiêng trời lệch đất, ngươi không nhận ra, cũng không trách ngươi!”."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1507"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1509"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);